import os import csv csvpath=os.path.join( "employee_data.csv")output=os.path.join("analysis.csv")emID=[]Firstname=[]Lastname=[]DOB=[]SSN=[]State=[]us_state_abbrev = {    'Alabama': 'AL',    'Alaska': 'AK',    'Arizona': 'AZ',    'Arkansas': 'AR',    'California': 'CA',    'Colorado': 'CO',    'Connecticut': 'CT',    'Delaware': 'DE',    'Florida': 'FL',    'Georgia': 'GA',    'Hawaii': 'HI',    'Idaho': 'ID',    'Illinois': 'IL',    'Indiana': 'IN',    'Iowa': 'IA',    'Kansas': 'KS',    'Kentucky': 'KY',    'Louisiana': 'LA',    'Maine': 'ME',    'Maryland': 'MD',    'Massachusetts': 'MA',    'Michigan': 'MI',    'Minnesota': 'MN',    'Mississippi': 'MS',    'Missouri': 'MO',    'Montana': 'MT',    'Nebraska': 'NE',    'Nevada': 'NV',    'New Hampshire': 'NH',    'New Jersey': 'NJ',    'New Mexico': 'NM',    'New York': 'NY',    'North Carolina': 'NC',    'North Dakota': 'ND',    'Ohio': 'OH',    'Oklahoma': 'OK',    'Oregon': 'OR',    'Pennsylvania': 'PA',    'Rhode Island': 'RI',    'South Carolina': 'SC',    'South Dakota': 'SD',    'Tennessee': 'TN',    'Texas': 'TX',    'Utah': 'UT',    'Vermont': 'VT',    'Virginia': 'VA',    'Washington': 'WA',    'West Virginia': 'WV',    'Wisconsin': 'WI',    'Wyoming': 'WY',}with open(csvpath, newline="") as employeefile:    csvreader=csv.reader(employeefile)    csv_header=next(csvreader)    for row in csvreader:         emID.append(row[0])        Firstname.append(row[1].split(" ")[0])        Lastname.append(row[1].split(" ")[1])        DOB.append(row[2].split("-")[1]+"/"+row[2].split("-")[2]+"/"+row[2].split("-")[0])        SSN.append("***-**-"+row[3].split("-")[2])        State.append(us_state_abbrev[row[4]])        final_data=zip(emID, Firstname, Lastname, DOB, SSN, State)print(final_data)with open (output, "w") as analysis:    new_file=csv.writer(analysis)    new_file.writerow(["Emp ID", "First Name", "Last Name", "DOB", "SSN", "State"])    new_file.writerows(final_data)        